package app.groceryapp.data.model.api.response.product;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;import java.util.List;public class Products {    @SerializedName("current_page")    @Expose    private Integer currentPage;    @SerializedName("data")    @Expose    private List<Product> productList;    @SerializedName("from")    @Expose    private Integer from;    @SerializedName("last_page")    @Expose    private Integer lastPage;    @SerializedName("per_page")    @Expose    private Integer perPage;    @SerializedName("to")    @Expose    private Integer to;    @SerializedName("total")    @Expose    private Integer total;    public Integer getCurrentPage() {        return currentPage;    }    public void setCurrentPage(Integer currentPage) {        this.currentPage = currentPage;    }    public List<Product> getProductList() {        return productList;    }    public void setProductList(List<Product> productList) {        this.productList = productList;    }    public Integer getFrom() {        return from;    }    public void setFrom(Integer from) {        this.from = from;    }    public Integer getLastPage() {        return lastPage;    }    public void setLastPage(Integer lastPage) {        this.lastPage = lastPage;    }    public Integer getPerPage() {        return perPage;    }    public void setPerPage(Integer perPage) {        this.perPage = perPage;    }    public Integer getTo() {        return to;    }    public void setTo(Integer to) {        this.to = to;    }    public Integer getTotal() {        return total;    }    public void setTotal(Integer total) {        this.total = total;    }}